import React, { Component } from "react";
import styled, { css } from "styled-components";
import SliderWithSnaps from "./SliderWithSnaps";

const EarlyLifeSection = ({monthlyCallback, yearsCallback}) => {
  return (
    <Container>
      <MonthlySavingsTitle>Monthly Savings</MonthlySavingsTitle>
      <SliderWithSnaps 
          callback={monthlyCallback} 
          min={200} 
          max={600} 
          interval={100}
        />
      <NumberOfYears>Number of Years</NumberOfYears>
      <SliderWithSnaps 
        callback={yearsCallback} 
        min={5} 
        max={20} 
        interval={5}
      />
    </Container>
  );
}

const MonthlySavingsTitle = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(255,255,255,1);
  height: 28px;
  width: 206px;
  text-align: center;
  font-size: 18px;
  margin-top: 48px;
  margin-left: 83px;
`;

const NumberOfYears = styled.span`
  font-family: Roboto;
  font-style: normal;
  font-weight: 400;
  color: rgba(255,255,255,1);
  height: 28px;
  width: 206px;
  text-align: center;
  font-size: 18px;
  margin-top: 48px;
  margin-left: 83px;
`;

export default EarlyLifeSection;
